import React, { Component } from 'react'
import { get } from '../../../../../utils/axios'
import Tr from './Tr'
import './index.css'

export default class ShowList extends Component {
    state={
        arr:[]
    }
    getall = async()=>{
        try{
            let res = await get('/api/getall')
            this.setState({arr:res.data.data})
        }catch(err){
            console.log("error",err)
     }
    }
    componenliidMount(){
        this.getall()
    }
    render() {
        return (
            <div id="table"><ul>          
                        <li><input type="checkbox" /></li>
                        <li>编号</li>
                        <li>日期</li>
                        <li>失物</li>
                        <li>姓名</li>
                        <li>学号</li>
                        <li>状态</li>
                        <li>领取地址</li>
                        <li>操作</li>
                    </ul> 
                    {this.state.arr.map((item,index)=>{
                        return <Tr {...item} key={index}></Tr>
                    })}
            </div>
        )
    }
}
